import React from "react"
import * as ReactDOMClient from "react-dom/client" 

class Header extends React.Component {
  render(){
    return(<header>{this}</header>)
  }
}

class App extends React.Component {
  render() {
    return (<div className="name">
    <Header titel="Шапка сайта"/>
    <h1>Привет</h1>
    <input placeholder="text" onClick={this.inputClick}></input>
    <p>hi hi hi hi hi </p>
  </div>)
  }

  inputClick() {console.log("Click")}
  inputMouseOver() {console.log("Mouse Over")}
}

const app = ReactDOMClient.createRoot(document.querySelector('#app'))

app.render(<App />)
